// Import Halaman Home
import Home from "./pages/Home";

function App() {
  /**
   * Menampilkan Halaman Home.
   * Tag div bisa diganti dengan tag <>.
   * Tag <> adalah React fragment
   */
  return (
    <>
      <Home />
    </>
  );
}

export default App;
